import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from "./App";
import Home from "./routes/Home";
import Todo from "./routes/Todo";


ReactDOM.render(
	<BrowserRouter>
		<Routes>
			<Route
				path="/"
				element={<Home />}
			/>
			<Route
				path="/todo"
				element={<Home />}
			/>
		</Routes>
	</BrowserRouter>,
	document.getElementById("root")
);
